import React, { Component } from "react";
let stars = [];
let star = " * ";

function starfill() {
  for (let i = 0; i < 5000; i++) {
    stars.push(star);
  }
}
starfill();

function sayHi() {
  alert("helllo");
}

export default class Starback extends Component {
  render() {
    return (
      <div>
        <div className="aboutlist">
          <ul className="ul">
            <li onClick={sayHi}>Work</li>
            <li>School</li>
            <li>Other</li>
            <li>All</li>
          </ul>
        </div>
        <div class="circle_container">
          <div class="circle_main">
            <div class="circle_text_container">
              <div class="circle_text">
                Here is an example of some text in my circle. Here is an example
                of some text in my circle. Here is an example of some text in my
                circle. Here is an example of some text in my circle. Here is an
                example of some text in my circle. Here is an example of some
                text in my circle. Here is an example of some text in my circle.
              </div>
            </div>
          </div>
        </div>
        <div className="stars">{stars}</div>
      </div>
    );
  }
}
